gTt(){return"I am looking for a position as a Flutter Developer Full-Stack/Front-end, where I can apply my front-end development skills, using Flutter technology to create exceptional user experiences. My goal is to contribute to innovative projects, collaborate with multidisciplinary teams, and apply my knowledge in clean code, MVC/MVVM architecture, and agile methodologies to deliver high-quality solutions.\nFurthermore, I am seeking opportunities to enhance my knowledge in back-end development, always striving to propose technological advancements in systems. I am enthusiastic about being part of a collaborative environment where I can develop efficient and impactful applications to meet user needs and contribute to the company's growth."},
